import React from "react";
import "./styles.css";

function App() {
  return (
    <div>
      <Header />
      <h1 style={{ fontStyle: "oblique", fontWeight: 200, 

      fontSize: 60 , letterSpacing: 5 , color: "black"}}>Grocery List</h1>
      <input type="checkbox" id="vehicle1" name="vehicle1" value="Bike"/>
      <label for="vehicle1"> apple</label><br/>

      <input type="checkbox" id="vehicle2" name="vehicle2" value="Car"/>
      <label for="vehicle2"> bananas </label><br/>
    </div>
  );
}

function Header() {
  var nameFirst = "Jihun";
  var nameLast = "Park";

  return <h1 className="header"

  style={{ fontStyle: "oblique", fontSize: 60 }}
  >Welcome to the grocerylist { nameFirst } { nameLast }</h1>
}


export default App;
